import React, {Component} from 'react';
import { Table, TableHeader} from 'react-mdl';
import {graphql} from 'react-apollo';
import {getProjectsQuery} from '../../queries/queries';


//import Table from 'rc-table';
import styled from 'styled-components';

/*
const columns =[
    {title:'Project', dataIndex: 'projectname', width:100},
    {title:'Distrbuted', dataIndex: 'bikenumber', width:100},
    {title:'Season', dataIndex: 'distributedyear', width:100},
    //{titel:'Action' ,dataIndex:'', render(){
    //    return <button>Delete</button>
  //  }}
];

const BodyRow = styled.tr`

    &:hover{
        background: palevioletred;
    }

`;

const components = {
    body: {
        row: BodyRow,
    },
};

*/





class BikeTable extends Component {

  
    render() {    

        var data = this.props.data;
    

        return(
                
            
                <Table 
                    sortable
                    shadow={0}
                    rows ={[data, 'projectname', data, 'bikenumber', data, 'distributedyear']}
                >
                    <TableHeader
                        name="Project"
                        sortFn={(a, b, isAsc) => (isAsc ? a : b).match(/\((.*)\)/)[1].localeCompare((isAsc ? b : a).match(/\((.*)\)/)[1])}
                    >Project</TableHeader>  

                    <TableHeader 
                        name="Distributed"
                    >Number of Bikes</TableHeader>

                    <TableHeader 
                        name="Season"
                    >Season</TableHeader>
                </Table>

            


        )
    }


}

export default graphql(getProjectsQuery)(BikeTable);
